        const highX = latitudes[latitudes.length - 1];
        const lowy = longitudes[0];
        const highy = longitudes[latitudes.length - 1];
        // center of the polygon is the starting point plus the midpoint
        const centerX = lowX + ((highX - lowX) / 2);
